import React from 'react';
import {GoogleMap} from 'react-google-maps';

 function Map() {
    return (
        <GoogleMap 
                defaultZoom={10} 
                defaultCenter={{lat : '12.9716', lng: '77.5946'}} 
            />
    )
}



export default Map;
